import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './components/login';
import Header from "./components/header";  // Import the Login component
import './App.css';
function App() {
    return (
        <Router>
            <Header /> {/* Render the header globally */}

            {/* Define Routes */}
            <Routes>
                <Route path="/" element={<Home />} /> {/* Your home page */}
                <Route path="/about" element={<About />} /> {/* About page */}
                <Route path="/services" element={<Services />} /> {/* Services page */}
                <Route path="/museums" element={<Museums />} /> {/* Museums page */}
                <Route path="/signin" element={<Login />} /> {/* The Login page */}
            </Routes>
        </Router>
    );
}

export default App;



